import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the modal for listing 'jun_1'
    await page.waitForSelector("[data-listing-id='jun_1']");
    await page.click("[data-listing-id='jun_1']");
    await page.waitForSelector('.amenity-tag');

    // Count the number of amenities
    const amenities = await page.$$('.amenity-tag');
    const amenitiesCount = amenities.length;

    // Take a screenshot of the amenities
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_amenities.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_amenities.png'));

    return {
      success: true,
      action: "Opened the modal for jun_1 and counted amenities",
      extractedData: { amenitiesCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

